import "./App.css";
///import AboutPage from './AboutPage';
//import ProductPage from './ProductPage';
//import UserProfilePage from './UserProfilePage';
// NotFoundPage from './NotFoundPage';

function App() {
  return (  
    <BrowserRouter>


    <Routes>
    <Route path="/" element={<homePage />} />
    </Routes>
    </BrowserRouter>

  );
}

export default App;
